import React from "react";
import "./about.scss";
import Process from "../../json/process.json";

export default function About() {
  const ProcessArray = [
    {
      id: 1,
      years: "2016 - 2019",
      details: [
        {
          detail_1: "Study: College of Foreign Economy and Relations school",
          detail_2: "Major: Management Information System",
        },
      ],
    },
  ];

  const ProcessList = ProcessArray.map((Process) => (
    <div className="About__process_item About__process_item_{Process.id}">
      <span className="About__dot"></span>
      <span className="About__year">{Process.years}</span>
      <ul className="About__detail"></ul>
    </div>
  ));

  return (
    <div className="About Section__spacing">
      <div className="Title">
        <h4>About Me</h4>
      </div>

      <div className="About__content">
        <div className="About__img">
          <img src="../assets/my_image.jpg" alt="This is me" />
        </div>
        <div className="About__des">
          <p>
            I was trained in "Management Information System" major in College at
            the start, and I fell in love with a subject called "Web design".
            That's the reason why I decided to study more and improved my Coding
            abilities day by day. I did these for the only purpose was to become
            a professional person in this field.
            <br />
          </p>
        </div>
      </div>

      <div className="About__process">
        {ProcessList}
        <div className="About__process_item About__process_item_2"></div>
        <div className="About__process_item About__process_item_3"></div>
        <div className="About__process_item About__process_item_4"></div>
      </div>
    </div>
  );
}
